import Cart from "./components/Cart/Cart";
import Layout from "./components/Layout/Layout";
import Products from "./components/Shop/Products";
import AuthContext from "./store/auth-context";

function App() {
  return (
    <AuthContext.Provider
      value={{
        showCart: true,
        MyCart: [],
        cartItems: 0,
      }}
    >
      <Layout>
        <Cart />
        <Products />
      </Layout>
    </AuthContext.Provider>
  );
}

export default App;
